import styled from "styled-components";

export const Container = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;

    height: 50px;
    width: 50px;

    padding: 5px;

    border-radius: 100%;
`;

export const Image = styled.img`
    width: 50px;
    height: 50px;
`;
